import React from "react";

export default function Quote() {
  return (
    <div class="p-4 w-full text-center border shadow-md sm:p-8 bg-gray-800">
      <h2 class="mb-2 text-3xl font-bold text-white">
        “We are healthcare professionals with over 45 years of health care
        experience. Together we want to use genetics, life-style optimization,
        disease prevention to help YOU live a fuller and happier life.”
      </h2>
    </div>
  );
}
